import React from "react"

class Pagination extends React.Component {

	render() {
		const {currPage, total_pages, nextPage, prevPage, changePage} = this.props;
		return (
			<div className="pagination">
				<input type="button" className="pagination-item" /*onClick={currPage > 1 ? prevPage : null}*/ value={"Prev"}/>
				<input type="button" className="pagination-item" value={currPage}/>
				<input type="button" className="pagination-item" onClick={changePage(currPage)} value={currPage+1}/>
				<input type="button" className="pagination-item" /*onClick={changePage(currPage+2)}*/ value={currPage+2}/>
				<input type="button" className="pagination-item" value={"..."}/>
				<input type="button" className="pagination-item" /*onClick={changePage(total_pages)}*/ value={total_pages}/>
				<input type="button" className="pagination-item"  /*onClick={currPage < total_pages ? nextPage : null}*/ value={"Next"}/>
			</div>
			);
	}
}



export default Pagination
